// GetRandomImage returns a random image from the list of sample images
func GetRandomImage() ImageAndID {
	if useSignedImage() {
		return ImagesWithSignatureNames[rand.Int()%len(ImagesWithSignatureNames)]
	}
	return ImageNames[rand.Int()%len(ImageNames)]
}

// GetRandomImageN returns a random image from the first n of the list of sample images
func GetRandomImageN(n int) ImageAndID {
	if n > len(ImageNames) {
		panic("n must be <= the available images")
	}

	if useSignedImage() {
		return ImagesWithSignatureNames[rand.Int()%len(ImagesWithSignatureNames)]
	}
	return ImageNames[rand.Int()%n]
}

func useSignedImage() bool {
	return rand.Intn(2) == 0
}

// ImageAndID encapsulates a name and id pair for a sample image
type ImageAndID struct {
	Name string
	ID   string
}

// FullName returns the name including the digest
func (i ImageAndID) FullName() string {
	return fmt.Sprintf("%s@%s", i.Name, i.ID)
}

// ImageCopyPair represents a pair of images with _orig and _copy suffixes that share the same digest
type ImageCopyPair struct {
	Orig ImageAndID
	Copy ImageAndID
}

// GetRandomImageCopyPair returns a random image pair from ImageCopies
// The pair contains an _orig image and its matching _copy image with the same digest
func GetRandomImageCopyPair() ImageCopyPair {
	if len(ImageCopies) == 0 {
		// Fallback to regular images if no copy pairs available
		img := GetRandomImage()
		return ImageCopyPair{Orig: img, Copy: img}
	}
	return ImageCopies[rand.Intn(len(ImageCopies))]
}

// GetRandomImageCopyPairN returns a random image pair from the first n pairs in ImageCopies
func GetRandomImageCopyPairN(n int) ImageCopyPair {
	if n > len(ImageCopies) {
		panic("n must be <= the available image pairs")
	}
	if n <= 0 {
		return GetRandomImageCopyPair()
	}
	return ImageCopies[rand.Intn(n)]
}

// NumImageCopyPairs returns the number of available image copy pairs
func NumImageCopyPairs() int {
	return len(ImageCopies)
}

